export const PATH_CONTACT = '/contact';
export const PATH_ABOUT = '/about';
export const PATH_FOR_DEVELOPERS = '/for-developers';
export const PATH_GALLERY = '/gallery';
export const PATH_MAIN = '/main';


export const LINKS = [
    {path: PATH_MAIN, label: 'Main'},
    {path: PATH_GALLERY, label: 'Gallery'},
    {path: PATH_ABOUT, label: 'About'},
    {path: PATH_CONTACT, label: 'Contact'},
    {path: PATH_FOR_DEVELOPERS, label: 'For developers'}
];
